import { Button, Card, CardContent, CircularProgress, Grid, TextField, Typography } from '@mui/material';
import { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';

export default function NewMedidor() {
  const [medidor, setMedidor] = useState({
    rut: '',
    codigo: '',
    nombre: '',
    fecha_creacion: '',
    descripcion: '',
  });

  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();
  const params = useParams();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

    try {
      // Paso 1: Crear un nuevo medidor
      const requestOptions = {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(medidor),
      };

      const medidorResponse = await fetch('http://localhost:4000/medidores', requestOptions);
      const newMedidor = await medidorResponse.json();

      // Paso 2: Crear una nueva entrada en la tabla cliente_medidor
      const clienteId = params.id; // Asegúrate de que params.id sea el ID del cliente al que deseas asociar el medidor

      await fetch('http://localhost:4000/associate', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          id: newMedidor.id,
          cliente_rut: clienteId,
        }),
      });

      setLoading(false);
      navigate('/');
    } catch (error) {
      console.error('Error al crear y asociar medidor:', error);
      setLoading(false);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setMedidor((prevMedidor) => ({
      ...prevMedidor,
      [name]: value,
    }));
  };

  return (
    <Grid container direction="column" alignItems="center" justifyContent="center">
      <Grid item xs={3}>
        <Card sx={{ mt: 5 }} style={{ backgroundColor: '#1e272e', padding: '1rem' }}>
          <Typography variant="h5" textAlign="center" color="white">
            Agregar Medidor
          </Typography>
          <CardContent>
            <form onSubmit={handleSubmit}>
              <TextField
                name="rut"
                value={medidor.rut}
                variant="filled"
                label="Rut"
                sx={{ display: 'block', margin: '.5rem 0' }}
                onChange={handleChange}
                inputProps={{ style: { color: 'white' }}}
                InputLabelProps={{ style: { color: 'white' }}}
              />
              <TextField
                name="codigo"
                value={medidor.codigo}
                variant="filled"
                label="Código"
                sx={{ display: 'block', margin: '.5rem 0' }}
                onChange={handleChange}
                inputProps={{ style: { color: 'white' }}}
                InputLabelProps={{ style: { color: 'white' }}}
              />
              <TextField
                name="nombre"
                value={medidor.nombre}
                variant="filled"
                label="Nombre"
                sx={{ display: 'block', margin: '.5rem 0' }}
                onChange={handleChange}
                inputProps={{ style: { color: 'white' }}}
                InputLabelProps={{ style: { color: 'white' }}}
              />
              <TextField
                name="fecha_creacion"
                value={medidor.fecha_creacion}
                variant="filled"
                label="Fecha de Creación"
                type="date"
                sx={{ display: 'block', margin: '.5rem 0' }}
                onChange={handleChange}
                inputProps={{ style: { color: 'white' }}}
                InputLabelProps={{ style: { color: 'white' }}}
              />
              <TextField
                name="descripcion"
                value={medidor.descripcion}
                variant="filled"
                label="Descripcion"
                multiline
                rows={4} sx={{ display: 'block', margin: '.5rem 0' }}
                onChange={handleChange}
                inputProps={{ style: { color: 'white' }}}
                InputLabelProps={{ style: { color: 'white' }}}
              />
              <Button variant="contained" color="primary" type="submit" disabled={!medidor.rut || !medidor.codigo || !medidor.nombre || !medidor.fecha_creacion}>
                {loading ? <CircularProgress color="inherit" size={24} /> : 'Guardar'}
              </Button>
            </form>
          </CardContent>
        </Card>
      </Grid>
    </Grid>
  );
}
